import React from 'react';

const Education = () => {
    return (
        <div className="education">
            <h2>Education</h2>
            <p>Mesa Community College</p>
            <p>Associates in Applied Science, Administration of Justice | 2003 - 2006</p>
            <p>Mesa High School</p>
            <p>High School, General Studies | 2000 - 2003</p>
            <p>Grade: A</p>
            <p>Activities and societies: JV and Varsity Basketball Team, Computer Technology</p>
        </div>
    );
};

export default Education;
